export default (function(a,b,c,d,e,f,g,h,i,j){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:g,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:c,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:c,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:c,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:g,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:h,pageSize:25,pageCount:h,total:5}}},rQnOXTS3HM:{data:{id:1405,attributes:{imdbId:"tt0107096",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BYTkyMmNiMjItYzJlZi00NzI5LTg4NmEtMzFjODgxMjMxNzk2XkEyXkFqcGdeQXVyNjMwMjk0MTQ@._V1_SX300.jpg",type:c,ratings:[{Source:"Internet Movie Database",Value:"6.8\u002F10"},{Source:"Rotten Tomatoes",Value:"40%"}],item_lang:{data:{id:2068,attributes:{title:"Heaven & Earth",plot:"The final movie in Oliver Stone's Vietnam trilogy follows the true story of a Vietnamese village girl who survives a life of suffering and hardship during and after the Vietnam war. As a freedom fighter, a hustler, young mother, a sometime prostitute, and the wife of a US. marine, the girl's relationships with men suggests an analogy of Vietnam as Woman and the U.S. as Man.",slug:"heaven-and-earth"}}},books:{data:[{id:7504,attributes:{title:e,description:"The author recounts her childhood in Ky La, including her membership in a children's troop, the rape and torture she endured before escaping to Saigon, Danang, and eventually the U.S.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=6HcpAQAAIAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a,f],firstBook:true,published:"1990-01-01",publisher:"Plume Books",subtitle:i}},{id:7505,attributes:{title:e,description:b,thumbnail:b,authors:[a,f],firstBook:d,published:"1989-01-01",publisher:b,subtitle:i}},{id:7506,attributes:{title:e,description:"It is said that in war heaven and earth change places not once, but many times. When Heaven and Earth Changed Places is the haunting memoir of a girl on the verge of womanhood in a world turned upside down. The youngest of six children in a close-knit Buddhist family, Le Ly Hayslip was twelve years old when U.S. helicopters langed in Ky La, her tiny village in central Vietnam. As the government and Viet Cong troops fought in and around Ky La, both sides recruited children as spies and saboteurs. Le Ly was one of those children. Before the age of sixteen, Le Ly had suffered near-starvation, imprisonment, torture, rape, and the deaths of beloved family members—but miraculously held fast to her faith in humanity. And almost twenty years after her escape to Ameica, she was drawn inexorably back to the devastated country and family she left behind. Scenes of this joyous reunion are interwoven with the brutal war years, offering a poignant picture of vietnam, then and now, and of a courageous woman who experienced the true horror of the Vietnam War—and survived to tell her unforgettable story.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=y8kveitjaykC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:d,published:"2012-10-03",publisher:j,subtitle:b}},{id:7507,attributes:{title:"Fathers and Daughters",description:"The youngest of six children in a close-knit Buddhist family, Le Ly Hayslip was twelve years old when U.S. helicopters landed in Ky La, her tiny village in central Vietnam. As the government and Viet Cong troops fought in and around Ky La, both sides recruited children as spies and saboteurs. Le Ly was one of those children. In this harrowing selection from the memoir of a girl on the verge of womanhood in a world turned upside down is a poignant picture of Vietnam, then and now, and of a courageous woman who experienced the true horror of the Vietnam War—and survived to tell her unforgettable story. A Vintage Shorts Vietnam Selection. An ebook short.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=sJQlDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a,f],firstBook:d,published:"2017-08-08",publisher:"Vintage",subtitle:"from When Heaven and Earth Changed Places"}},{id:7508,attributes:{title:"Child of War, Woman of Peace",description:"The inspiring story of an immigrant's struggles to heal old wounds in the United States, this is the sequel to When Heaven and Earth Changed Places, Le Ly Hayslip's extraordinary, award-winning memoir of life in wartime Vietnam.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=r9ERRxodoK8C&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:d,published:"2011-04-13",publisher:j,subtitle:b}}]}}},meta:{}}},prerenderedAt:1681377335609}}("Le Ly Hayslip","","movie",null,"When Heaven and Earth Changed Places","Jay Wurts","series",1,"A Vietnamese Woman's Journey from War to Peace","Anchor"))